        "# 3. Preprocess the images, in order to create the dataset\n",
        "\n",
        " The following steps were applied into the following code:\n",
        "\n",
        "  a) Opening the image file\n",
        "  \n",
        "  b) Reading the image file from the directory then applying onto it the colour format\n",
        "  \n",
        "  c) Adjust the image dimensions to correspond with the input size of the Deep Learning model's Input layer.\n",
        "  \n",
        "  d) Transform the image's pixel values to a floating-point data type.\n",
        "  \n",
        "  e) Normalize the image's pixel values to be within the range of 0 and 1, scaling down from 0 to 255, which enhances \t\t  convergence speed.\n",
        "  \n",
        "  f) Convert the data into a numpy array or a tensor object.\n",
