        "    #Training ResNet-50 model and calculating the loss and accuracy\n",
        "\n",
        "train_acc = []\n",
        "val_acc = []\n",
        "train_loss = []\n",
        "val_loss = []\n",
        "for epoch in range(40):\n",
        "    train_acc.append(history_list[epoch].history['accuracy'])\n",
        "    val_acc.append(history_list[epoch].history['val_accuracy'])\n",
        "    train_loss.append(history_list[epoch].history['loss'])\n",
        "    val_loss.append(history_list[epoch].history['val_loss'])\n",
        "\n",
        "No_Of_Epochs = range(40)\n",
